export default class golanguage {
    constructor() {
    }
    static run(path) {
        return GoLanguageApi.run(path);
    }
    static install() {
        return GoLanguageApi.install();
    }
    static uninstall() {
        return GoLanguageApi.uninstall();
    }
    static version() {
        return GoLanguageApi.version();
    }
}
